import React from 'react'
import SocialItem from './SocialItem';

function Social() {
    return (
        <div>
            <ul className='list-group'>

                <SocialItem
                    media="Facebook"
                    id="facebook" />

                <SocialItem 
                media="Youtube" id="youtube" />
                <SocialItem media="Instagram" id="instagram" />
            </ul>
        </div>
    );
}
export default Social
